import React from 'react';
import Item from '../Item/Item';
import './Items.css';

function Items(props) {
    return (
        <div>
            {props.items.map(function (value, index) {
                return showItem(prop) ? <Item key={index} item={value} onItemClick={props.onItemClick} onDeleteItem={props.onDeleteItem} ></Item> : null
            })}
        </div>
    );
}

export default Items;
